// import classNames from 'classnames';
import types from 'prop-types';
import React from 'react';

// Styles

import './styles.scss';
import Button from '../../../../../../components/Button';

// ----------------

export const Project = ({ data }) => {
    const modify = classNames({
      'change': props,
    });

    return (
        <div className="project__common-wrapper">
            <div className="project__image-wrap">
                <div
                    className="project__image"
                    style={{ backgroundImage: `url(${data.image})` }}
                ></div>
            </div>
            <div className="project__data-block">
                <div className="project__title">{data.title}</div>
                <div className="project__subtitle">{data.subtitle}</div>
                <div className="project__text">{data.text}</div>
                <Button withBorder borderColor largeSize>More Details</Button>
                <div className="first-project__adress">
                    <i className="material-icons">location_on</i>
                    {data.adress}
                </div>
            </div>
        </div>
    );
};

// ----------------

// Type of props

Project.propTypes = {
    prop: types.string,
};

// Default value for props

Project.defaultProps = {};
